import React from "react";

function Header(props) {
  console.log(props.standings);
  let Standings = props.standings;
  let Ruler = props.ruler;
  if (props.isHome() === true) {
    return (
      <div className="navBar">
        <Standings className="logo" id="Standings" />
        <img src={props.logo} className="logo" alt="csgo_logo"></img>
        <Ruler className="logo" id="Ruler" />
      </div>
    );
  }
  return;
}

export default Header;
